tables.table_schema:
CREATE TABLE health_assessment (
  user_id INT,
  assessment_date DATE,
  depression_score FLOAT,
  anxiety_score FLOAT
);

CREATE TABLE patients (
  patient_id UUID PRIMARY KEY,
  age INT,
  gender VARCHAR,
  diagnosis TEXT
);

CREATE TABLE therapists (
  therapist_id UUID PRIMARY KEY,
  name VARCHAR,
  specialization TEXT
);
